import React from 'react';

const Services = () => {
  return (
    <section id="services" className="py-16 bg-white px-6">
      <h2 className="text-3xl font-semibold text-center mb-10">Our Services</h2>
      <div className="grid md:grid-cols-3 gap-8">
        <div className="p-6 shadow-lg rounded-lg border">
          <h3 className="text-xl font-bold mb-2">Virtual CFO</h3>
          <p>End-to-end financial oversight, MIS, budgeting & investor reporting.</p>
        </div>
        <div className="p-6 shadow-lg rounded-lg border">
          <h3 className="text-xl font-bold mb-2">Tax & Compliance</h3>
          <p>Income Tax, GST, ROC, TDS compliance handled accurately & timely.</p>
        </div>
        <div className="p-6 shadow-lg rounded-lg border">
          <h3 className="text-xl font-bold mb-2">Startup Consulting</h3>
          <p>Pitch deck, business model validation, MCA, DPIIT & funding support.</p>
        </div>
      </div>
    </section>
  );
};

export default Services;
